// Process input items
for (const item of items) {
  try {
    // Get the original iframe HTML from the body
    const originalIframe = item.json.data[0].body;

    // Escape double quotes in attribute values
    const modifiedIframe = originalIframe.replace(/"/g, '\\"');

    // Return only the modified iframe as output
    item.json = { result: modifiedIframe };
  } catch (error) {
    item.json = { error: "Failed to process iframe" };
  }
}

return items;

